import React, { useEffect, useState } from "react";

export const Detail_Image_Section = (props) => {

    const [FirstTouch, updateStart] = useState(0)
    const [LastTouch, updateLast] = useState(0)
    const [Distance, updateDistance] = useState(0)

    const [Highlighter, updateHighlight] = useState([
        'blue', 'black', 'black'])

    useEffect(()=>{
    },[])

    const photo_dispenser = (input) => {

        switch(typeof input){
            case('object'):
            // console.log(input[0].getUrl())
            return <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent:'start',
                        width:'60vw',
                        overflow: 'scroll',
                        aspectRatio: '1',
                        border: 'black solid 3.5px',
                        borderRadius: '15px'
                    }}
                    
                    

                    onTouchStart={(e)=>{
                        const touches = e.changedTouches[0].pageX;
                        updateStart(touches)

                    }}

                    onTouchEnd={(e)=>{
                        const touches = e.changedTouches[0].pageX
                        updateLast(touches)

                        const Arrow = FirstTouch - LastTouch
                        switch(typeof e.target.parentNode.childNodes.length){

                                case('number'):

                                const Length = e.target.parentNode.childNodes.length

                                if(Arrow>100){
                                updateDistance(Distance+e.target.offsetWidth)

                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance+e.target.offsetWidth,
                                    behavior:'smooth'
                                })
                                
                                if(Distance>e.target.offsetWidth*(Length-1)){
                                    updateDistance(e.target.offsetWidth*Length)
                                }
                                break;
                                return;}

                                if(Arrow<-100){
                                updateDistance(Distance-e.target.offsetWidth)

                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance-e.target.offsetWidth,
                                    behavior:'smooth'
                                })

                                if(Distance<1){
                                    updateDistance(0)
                                }
                                break;
                                return;}
                                
                                if(-100<Arrow<100){
                                    
                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance,
                                    behavior:'smooth'
                                    })}
                        
                                case('undefined'): 
                                break;
                                return;

                            }


                                if(Distance<1){
                                console.log('first')
                                updateHighlight([
                                    'black', 'blue', 'black'
                                ])}

                                if(0<Distance<e.target.offsetWidth*(e.target.parentNode.childNodes.length-1)){
                                console.log(Distance,'middle')
                                updateHighlight([
                                    'black', 'blue', 'black'
                                ])}
                                
                                if(Distance>e.target.offsetWidth*(e.target.parentNode.childNodes.length-1)){
                                console.log(Distance,'last')
                                updateHighlight([
                                    'black', 'black', 'blue'
                                ])}

                        }
                    }

                    >

                        {input.map((element)=>{
                        return <img
                        style={{
                            width:'60vw',
                            objectFit: 'cover'
                        }}
                        src={element.getUrl()}
                        >
                        </img>
                        })}

                    </div>

            case('undefined'):
            return;
        }

    }

    const photos_Dot_Index = (input) => {
        switch(typeof input){
            case('object'):
            
            return <React.Fragment>

            <div
                style={{
                    fontSize: '10vw',
                    display: 'flex',
                    flexDirection: 'row',
                    justifyContent: 'center'
                }}
            >
            <span
             style={{
                color:`${Highlighter[0]}`
             }}
            >&#8226;</span>
            <span
             style={{
                color:`${Highlighter[1]}`
             }}
            >&#8226;</span>
            <span
             style={{
                color:`${Highlighter[2]}`
             }}
            >&#8226;</span>
            </div>

            </React.Fragment>

            case('undefined'):
            return;
        }
    }

    const review_dispenser = (input) => {
        
        switch(typeof input){
            case('object'):
            return <div>

                {input.map((element)=>{
                    return <div
                    style={{
                        width: '50vw',
                        padding: '0 5vw',
                        border: 'black solid 3.5px',
                        borderRadius: '15px',
                        fontFamily: '큐트신민상',

                    }}
                    >

                    <div>
                    
                    <img
                    src={element.profile_photo_url}
                    style={{
                    width: '10vw'
                    }}
                    ></img>
                    <span>{element.author_name}</span>

                    <div>{element.rating}</div>
                    
                    </div>

                    <div>{element.text}</div>


                    </div>
                })}
                

                </div>

        }
        
    }

    return <React.Fragment>

    {photo_dispenser(props.photos)}
    {photos_Dot_Index(props.photos)}
    {review_dispenser(props.reviews)}

    </React.Fragment>

}

export default Detail_Image_Section
